import Clock from 'react-digital-clock';

const ToDoList = () =>{

  
    
    return (
        <>
        <div style = {{ marginBottom : "20px" }}>

            <h1><Clock /></h1>

        </div>
        </>            
    );

};

export default ToDoList;
